import React from 'react'
import Grid from "@material-ui/core/Grid";
import CompositionCard from "./CompositionCard/CompositionCard";
import styled from 'styled-components'
import Container from "@material-ui/core/Container";

const CompListWrapper = styled(Container)`
        padding-top: ${({theme}) => theme.spacing(2)}px;
        padding-bottom: ${({theme}) => theme.spacing(2)}px;
        background-color: rgba(33,33,33,.95);
        border-radius: 20px;
`

function CompositionList({compositions = '', ...props}) {
    const compositionNodes = compositions.length > 0 ?
        compositions.map((compInfo, id) => <CompositionCard key={id} info={compInfo}/>) :
        <div>Не найдено ни одной композиции...</div>

    return (
        <CompListWrapper maxWidth="xl">
            <Grid container spacing={4}>
                {compositionNodes}
            </Grid>
        </CompListWrapper>
    );
}

export default CompositionList
